import styled from 'styled-components';


export const NavigationBar = styled.nav`
  font-family: 'Lato', sans-serif;
  display: flex;
  justify-content: flex-end;
  width: 100%;
  height: 20%;

    

    .uList {
      display: flex;
      align-items: baseline;
      justify-content: flex-end;
      height: 15%;
      width: 50%;
      padding-right: 128px;

      
    
        
        
        img {
          margin: 3.5% 0;
          width: 24px;
          height: 26px;
        }        
    }  
  }  
`;
